import './Left.css';

const AboutUs = () => (
  <div>About Us</div>
)

const Login = () => (
  <div>Login</div>
)

const Logout = () => (
  <div>Logout</div>
)

function Left() {
  return (
    <div className="Left">
      <AboutUs />
      <Login />
      <Logout />
    </div>
  );
}

export default Left;
